import About from "./Components/About/About";
import BannerIntro from "./Components/BannerIntro/BannerIntro";
import Navbar from "./Components/Navbar/Navbar";
import Skills from "./Components/Skills/Skills";
import Partfolio from "./Components/Portfolio/Partfolio";
import Contact from "./Components/Contact/Contact";
import Footer from "./Components/Footer/Footer";
import { useEffect, useState } from "react";
import Loading from "./Components/Loading/Loading";

function App() {
  const [isLoading, setIsLoading] = useState(true);

  const isLoadingHandler = () => {
    setTimeout(() => {
      setIsLoading(false);
    }, 10000);
  };

  useEffect(() => {
    isLoadingHandler();

    console.log(isLoading);
  }, []);

  return (
    <>
      <Loading className={``} />
      <div className={ `text-white scroll-smooth ${isLoading && 'hidden'} `}>
        <button onClick={isLoadingHandler} className="text-black" >click</button>
        <Navbar className="" />
        <BannerIntro />
        {/* <h1>About me</h1>
        <h1>Skills</h1>
        <h1>work portfolio</h1>
        <h1>contact me</h1>
        <h1>footer</h1>  */}
        <div className="bg-image2 bg-cover -mt-1 scroll-smooth">
          <About />
          <Skills />
          <Partfolio />
        </div>
        {/* <Contact /> */}
        <Footer />
      </div>
    </>
  );
}

export default App;
